import React from 'react';
import { Link } from 'react-scroll';
import './App.css';

import Home from './components/Home';
import About from './components/About';
import Experience from './components/Experience';
import Projects from './components/Projects';

function App() {
  return (
    <div className="app-container">
      <nav className="navbar">
        {/* Left side: Logo and Nav links */}
        <div className="nav-left">
          <div className="logo">Vishal Navin</div>
          <ul className="nav-links">
            <li><Link to="home" smooth={true} duration={500}>Home</Link></li>
            <li><Link to="about" smooth={true} duration={500}>About</Link></li>
            <li><Link to="experience" smooth={true} duration={500}>Experience</Link></li>
            <li><Link to="projects" smooth={true} duration={500}>Projects</Link></li>
          </ul>
        </div>

        {/* Right side: Social Icons */}
        <div className="nav-right">
          <a href="mailto:your.email@example.com"><i className="fas fa-envelope"></i></a>
          <a href="https://github.com/yourgithubprofile"><i className="fab fa-github"></i></a>
          <a href="https://www.linkedin.com/in/yourlinkedinprofile"><i className="fab fa-linkedin"></i></a>
          <a href="/your-portfolio-link" className="edit-icon"><i className="fas fa-pen"></i></a>
        </div>
      </nav>

      {/* Sections */}
      <section id="home">
        <Home />
      </section>
      <section id="about">
        <About />
      </section>
      <section id="experience">
        <Experience />
      </section>
      <section id="projects">
        <Projects />
      </section>
    </div>
  );
}

export default App;
